  [],\n\t\"revision_timestamp\": \"2016-07-27T22:25:06.927224\",\n\t\"name\": \"final-environmental-assessment-for-the-proposed-guam-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This EA considers four alternatives for
  the proposed National Wildlife Refuge on Guam and three options for including submerged
  lands in the proposed Refuge. The endangered species problems on Guam are so complex
  that a cooperative approach among the Government of Guam, the U.S. Fish and Wildlife
  Service (Service), and the Department of Defense (DOD) is necessary to stem the
  rising tide of extinction. Both the Government of Guam and the Federal government
  share common goals for the recovery of endangered and threatened species, the protection
  of native flora and fauna, the conservation of unique ecosystems, and the maintenance
  of native biological diversity. To meet these shared goals and responsibilities,
  the Service is studying the feasibility of establishing a National Wildlife Refuge
  (Refuge) on certain lands and waters on Guam to be managed in coordination with
  the Government of Guam and the DOD. The proposed Refuge would be established to:
  (1) protect and recover endangered and threatened species; (2) protect and restore
  essential habitats for listed species and implement recovery actions; (3) protect
  and manage migratory birds and other native wildlife and their habitats in order
  to conserve Guam's biological diversity; (4) control predation upon native wildlife
  by harmful alien species, particularly by the brown tree snake, and protect wildlife
  from poaching; (5) complement ongoing Government of Guam and Federal programs in
  natural resources management, conservation, law enforcement, research, and education;
  (6) provide opportunities for public education, enjoyment of wildlife, cultural
  use of resources, and scientific research; and (7) maintain the scenic values of
  the protected areas. The proposed Refuge would be established on Federal and Government
  of Guam lands through a memorandum of understanding and managed through cooperative
  agreements among the U.S. Navy, the U.S. Air Force, the Government of Guam, and
  the Service.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
